import React from 'react';
import { Image, Grid, Header, Icon, Container, Divider } from 'semantic-ui-react';
import cover from '../static/cover.png';
import NavigationBar from './Sidebar.jsx';
import '../App.css';

class Wrapper extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      container: 'route1'
    };
  };

  render() {
    return(
        <Grid>
        <Grid.Row>
            <Grid.Column width={1}>
              <NavigationBar />
            </Grid.Column>
            <Grid.Column width={15}>
              <div>
                <Grid.Row>
                <Image src = {cover} size = 'medium' centered/>
                <Divider hidden/>
                </Grid.Row>
                <Grid.Row>
                  <Container text textAlign = 'center'>
                  <p className = 'textblock'>
                    The Nepalese Students Association is a social 
                    and cultural organization that was established 
                    to unite patriots who are of Nepali origin or 
                    have interest in Nepalese culture. 
                    The main purpose of NSA is to promote 
                    and raise awareness about Nepalese language, 
                    literature, cultural and arts through various 
                    activities.
                  </p>
                  </Container>
                </Grid.Row>
                <Divider hidden/>
                <Grid.Row>
                <div>
                  <Header as='h2' icon textAlign='center'>
                    <Icon name='gears' circular />
                    <div>Icons made by <a href="https://www.flaticon.com/authors/freepik" title="Freepik">Freepik</a> from <a href="https://www.flaticon.com/" title="Flaticon">www.flaticon.com</a></div>
                    <Header.Content>NAMASTE!!</Header.Content>
                  </Header>
                </div>
                </Grid.Row>
              </div>
            </Grid.Column>
          </Grid.Row>
        </Grid>
  )};
};

export default Wrapper;
